import React, { Component, useState, useEffect, ImageBackground, View, Text } from "react";
import { Grid } from "@material-ui/core";
import Button from "@material-ui/core/Button";
import Header from "./Header";
import Content from "./Content";
import DisplayHoldings from "./DisplayHoldings.jsx";
import Footer from "./Footer.jsx";
import { createTheme, ThemeProvider } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import "./styles.css";

const darkTheme = createTheme({
  palette: {
    type: 'dark',
  },
});

function Home() {
	return (
		<ThemeProvider theme={darkTheme}>
			<CssBaseline/>
			<Grid container direction="column">
				<Grid item>
					<Header
					fixed
					changeColorOnScroll={{
					  height: 400,
					  color: "white",
					}}/>
		        </Grid>

		        <img src={require('./assets/img/background.jpg')} className="photo"/>
		        <div>
		          <Grid>
		            <Grid item xs={12} sm={12} md={6}>
		              <h1>Your Story Starts With Us.</h1>
		              <h4>
		                Every landing page needs a small description after the big bold
		                title, that{"'"}s why we added this text here. Add here all the
		                information that can make you or your product create the first
		                impression.
		              </h4>
		              <br />
		            </Grid>
		          </Grid>
		        </div>


		        <br></br>

		        <Grid item container>
		        	<Grid item xs={false} sm={2} />
	        		<Grid item xs={12} sm={8}>
	        			<Content />
    				</Grid>
    				<Grid item xs={false} sm={2} />
		        </Grid>
		    </Grid>
		    <br /><br /><br /><br /><br />
		    <Footer />
		    <br /><br /><br />
		</ThemeProvider>
	);
}

export default Home;
